import React from "react";
import { Link } from "react-router-dom";

const Navbar = props => {
  return (
    <nav className="navbar">
      <h1>
        <i className={"fab fa-github"}> </i> {props.navTitle}
      </h1>
      <Link to="/">
        <h1>Home</h1>
      </Link>
      <Link to="/image">
        <h1>Images</h1>
      </Link>
    </nav>
  );
};

export default Navbar;
